INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (1,1,1,'최상','화법이 완벽하군요!','화법이 우수한 학생입니다. 화법은 시험지에 가장 앞부분에 있는 영역으로 시험 전체의 컨디션을 좌우합니다. 앞으로 절대 실수 하는 일 없이 정확하게 답을 찾길 바랍니다. 뒤에 나올 독서와 문학영역의 시간 확보를 위해 화법에서 시간 줄이는 연습을 해두는 것도 추천해드립니다.', 'panel-primary');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (2,1,2,'상','조금　더 신중한 정답 선택을!','화법은 상위권 학생들은 반드시 실수가 있어서는 안 될 영역입니다. 앞으로 정확한 정답의 근거를 찾는 훈련을 하여 만점을 받길 바랍니다.', 'panel-success');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (3,1,3,'중','개념과 기출 문제풀이를 병행하세요!','EBS수능 연계 교재에서 제시하는 화법 개념과 격률 등을 익히고, 개념을 기출문제에 적용하여 답을 찾는 문제 풀이 훈련을 더 하길 바랍니다. ', 'panel-warning');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (4,1,4,'하','개념과 기본문제를 먼저 풀어보세요','교과서 및 EBS 수능 연계 교재에서 제시하는 화법 개념 정리를 하고, 개념 적용 기본 문제를 먼저 풀어 본 후 기출 문제를 풀어 볼 것을 권해드립니다.', 'panel-danger');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (5,2,1,'최상','작문이 완벽하군요!','작문이 우수한 학생입니다. 작문영역은 시험지 앞부분에 있는 영역으로 시험의 컨디션을 좌우합니다. 앞으로도 실수 없이 완벽하게 준비하길 바랍니다. 작문에서는 가능한 시간을 줄이기 보다는 정확성에 더 집중하길 바랍니다.', 'panel-primary');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (6,2,2,'상','실수가 있어서는 안되는 영역입니다!','작문은 상위권 학생들은 반드시 실수가 있어서는 안 될 영역입니다. 앞으로 정확한 정답의 근거를 찾는 훈련을 하여 만점을 받길 바랍니다. 작문 중 고쳐쓰기의 경우 문법적 사항을 알아야 답을 찾을 수 있는 경우가 있으므로 유의하세요. ', 'panel-success');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (7,2,3,'중','주제에 맞는 글쓰기의 구조를 익히세요!','글에 주제에 맞는 글쓰기 구조를 익히도록 하세요. 글의 주제를 부각할 수 있는 표현법을 익히도록 하세요. 주제를 명확히 기억하고 문제를 푸는 훈련을 하시면 좋습니다.  고등학교 교과서 중 통일성과 응집성을 다루는 단원에 대한 복습도 추천합니다. ', 'panel-warning');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (8,2,4,'하','수능 작문문제의 개념을 정리하세요!','교과서 및 ebs 수능 연계 교재에서 제시하는 작문 개념 정리를 하시길 바랍니다. 개념 정리후 기본 문제를 먼저 풀어 본후 기출 문제를 풀어 볼 것을 권해 드립니다. ', 'panel-danger');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (9,3,1,'최상','문법의 신이군요!','문법이 우수한 학생입니다. 문법 영역은 오답률이 높아 변별력을 가르는데 중요한 영역입니다. 일반적인 문법 지식과는 다른 예외의 상황을 어려운 문제에서 제시하기도 합니다. 제시하는 보기를 자세히 보시기 바랍니다. 기존의 공부한 내용과 다를 경우 실수할 가능성이 있어요.', 'panel-primary');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (10,3,2,'상','신유형 연습이 부족한건 아닐까요?','특별히 자주 틀리는 문제가 있다면, 해당문제에 필요한 문법 내용을 다시 한번 완벽히 정리하고 이해한 후 암기하는 것이 필요합니다. 보기에서 주어진 문법적 정보를 최대한 활용하여 실수하지 않길 바랍니다. 최근 생긴 보기가 긴 지문에 대비 할 수 있도록 신유형 연습을 권해드립니다. ', 'panel-success');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (11,3,3,'중','문법 개념 정리를 빠짐없이 하세요!','자주 틀리는 문제가 있다면, 해당문제에 필요한 문법 내용을 다시 한번 완벽히 정리하고 이해한 후 암기하는 것이 필요합니다. 보기에서 주어진 문법적 정보를 최대한 활용하여 실수하지 않길 바랍니다. 정리한 문법적 사항이 문제 풀 때 어떻게 이용되는지 확인하면서 기출문제를 풀면 좋습니다.', 'panel-warning');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (12,3,4,'하','교과서와 ebs 연계 교재의 개념을 정리하세요!','문제에서 묻는 문법적 용어나 개념을 모르는 것이 있는지 확인합시다. 모르는 것이 있다면 독서와 문법 교과서를 활용하여 정리해둡시다.  ebs 수능 특강 교재에서 제시하는 단원은 모두 완벽히 정리하는 것을 추천해 드립니다.', 'panel-danger');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (13,4,1,'최상','당신은 독해력의 왕입니다.','독서영역이 우수한 학생입니다. 그러나 최근 독서 지문이 길어지고 하나의 지문 안에서 처리해야할 정보의 양도 늘고 있습니다. 또 실제 수능시험장에서 긴장으로 인해 체감 난이도가 가장 높은 영역입니다. 지속적으로 독해력 감을 유지할 수 있게 공부하길 바랍니다. 시간활용과 고난도 문제 연습을 위해 MEET, DEET 기출 문제를 풀어보는 것도 권해 드립니다.', 'panel-primary');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (14,4,2,'상','어디에서 실수를 할까요?','본인이 특정 영역(인문, 사회, 과학, 예술 등)에서 실수가 있는지 확인하시고 그 부분을 집중적으로 대비하여 보완할 필요가 있습니다. 혹은 특정유형(사실적독해, 추론적 독해, 비판적 독해) 혹은 내용확인이나 그래프 및 그림 활용하는 문제 등에서 오답이 나온다면 기출문제를 활용하여 비슷한 유형의 문제가 지문의 어떤 부분을 활용하고 있는지 연결하면서 분석하는 방법을 권해드립니다. 영역이나 유형과 상관없이 1-2개를 지속적으로 틀린다면 꼼꼼히 문제를 푸는 연습이나 정답과 매력적인 오답을 구분하는 근거를 찾는 훈련이 필요합니다.', 'panel-success');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (15,4,3,'중','지문 안의 정보 처리 시간을 단축하세요.','본인이 특정 영역(인문, 사회, 과학, 예술 등)에서 실수가 있는지 확인하시고 그 부분을 집중적으로 대비하여 보완할 필요가 있습니다. 혹은 특정유형(사실적독해, 추론적 독해, 비판적 독해) 혹은 내용확인이나 그래프 및 그림 활용하는 문제 등에서 오답이 나온다면 기출문제를 활용하여 비슷한 유형의 문제가 지문의 어떤 부분을 활용하고 있는지 연결하면서 분석하는 방법을 권해드립니다.  글을 읽고도 이해가 되지 않는다면 직접 손으로 적고 분석하며 완벽히 자기 것으로 만드는 훈련을 하세요. 반복적으로 분석한 후 나중엔 읽으면서 머릿속으로도 이해와 정보처리가 가능할 정도까지 훈련하세요.', 'panel-warning');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (16,4,4,'하','독해 기본 방법을 익히도록 하세요.','글 읽기 능력에 대한 점검이 필요합니다. 독서 개념교재나 독해 방법론 교재 등을 활용하여 수능형 지문의 특징을 정리하고 이해하는 것이 필요합니다. 글이 어렵다면 직접 손으로 정리하고 분석하는 연습을 하길 권해드립니다. 절대적 시간 투자 없이 바로 이해되길 바라는 것은 욕심입니다. 본인이 정성껏 분석하고 정리한 내용을 보고 문제를 풀어보시길 바랍니다. 글을 보지 않고도 분석한 내용으로 문제가 해결된다면 제대로 정리한 것입니다. 어휘 문제는 독해력과 별도로 꼭 맞출 수 있길 바랍니다.', 'panel-danger');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (17,5,1,'최상','당신은 이 시대의 문학 소녀! 소년!','문학영역이 우수한 학생입니다. 그러나 최근 문학 영역에서 비평문을 포함하여 출제하는 신유형과 갈래 복합이 더욱 다양해지고 있습니다. 이점에 유의하여 준비하시길 바라며, 상위권 친구일수록 문학 해석의 기준에서 본인도 모르게 자신의 감상기준을 적용하는 실수를 할 수 있습니다. 출제자의 기준임을 꼭 인지하세요.', 'panel-primary');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (18,5,2,'상','정답과 매력적인 오답 사이에서 갈등하나요?','문학 갈래 중 어떤 갈래에서 오답이 나오는지 확인하시고 해당 갈래에 대한 기출 분석과 풀이 방법 점검을 다시 하시길 바랍니다. 예를 들어 고전시가에서 오답이 자주 나온다면, 고전시가 정리 필수입니다. 또는 현대시나 현대 소설에서 오답이 자주 나온다면, 보편적 감상 기준 및 출제자의 의도에 맞는 정답 선택 연습을 하시길 바랍니다. ebs 수능 연계 교재의 활용 역시 암기형 보다는 해석력 위주로 공부하시면 좋습니다. 영역이나 유형과 상관없이 1-2개를 지속적으로 틀린다면 꼼꼼히 문제를 푸는 연습이나 정답과 매력적인 오답을 구분하는 근거를 찾는 훈련이 필요합니다.', 'panel-success');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (19,5,3,'중','갈래별 취약점이 있다면 집중 보완하세요!','문학 갈래 중 어떤 갈래에서 오답이 나오는지 확인하시고 해당 갈래에 대한 기출 분석과 풀이 방법 점검을 다시 하시길 바랍니다. 예를 들어 고전시가에서 오답이 자주 나온다면, 고전시가 정리 필수입니다. 또는 현대시나 현대 소설에서 오답이 자주 나온다면, 보편적 감상 기준 및 출제자의 의도에 맞는 정답 선택 연습을 하시길 바랍니다. ebs 수능 연계 교재에서 다루는 작품의 기본적 정보를 익힌 상태에서 해석력을 갖기를 바랍니다.', 'panel-warning');
INSERT INTO SOLUTION_INFO (ID, DOMAIN, LEVEL, DESCRIPTION, TITLE, SOLUTION, STYLE) values (20,5,4,'하','수능형 문학 작품의 특성을 이해하도록 해요!','문학의 각 갈래별 특성을 이해하고 각각 읽는 방법이나, 갈래별로 출제되는 문제 유형을 정리하시면 좋습니다. ebs 수능 연계 교재에서 다루는 작품을 중심으로 공부하시는 것을 추천해드립니다.', 'panel-danger');
